import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

// Import Containers
import { DefaultLayoutComponent } from 'app/containers';

import { P404Component } from './views/error/404.component';
import { P500Component } from './views/error/500.component';
import { LoginComponent } from './views/login/login.component';
import { RegisterComponent } from './views/register/register.component';

export const routes: Routes = [
    {
        path: '',
        redirectTo: 'dashboard',
        pathMatch: 'full'
    },
    {
        path: '404',
        component: P404Component,
        data: {
            title: 'Page 404'
        }
    },
    {
        path: '500',
        component: P500Component,
        data: {
            title: 'Page 500'
        }
    },
    {
        path: 'login',
        component: LoginComponent,
        data: {
            title: 'Login Page'
        }
    },
    {
        path: 'register',
        component: RegisterComponent,
        data: {
            title: 'Register Page'
        }
    },
    {
        path: '',
        component: DefaultLayoutComponent,
        data: {
            title: 'Home'
        },
        children: [
            {
                path: 'configuration',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./entities/configuration/configuration.module')['ConfigurationModule']);  }, function() {    reject({ loadChunkError: true });  });}) }
            },
            {
                path: 'batch',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./entities/batch-management/batchmgnt.module')['BatchmgntModule']);  }, function() {    reject({ loadChunkError: true });  });}) }
            },
            {
                path: 'nurserystock',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./entities/nursery-stock-management/nursery-stock.module')['NurseryStockMgntModule']);  }, function() {    reject({ loadChunkError: true });  });}) }
            },
            {
                path: 'godown',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./entities/godown-management/godown.module')['GodownModule']);  }, function() {    reject({ loadChunkError: true });  });}) }
            },
            {
                path: 'dashboard',
                loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('./views/dashboard/dashboard.module')['DashboardModule']);  }, function() {    reject({ loadChunkError: true });  });}) }
            }
        ]
    }
];

@NgModule({
    imports: [RouterModule.forRoot(routes)],
    exports: [RouterModule]
})
export class AppRoutingModule {}
